Return an iterator that escapes each char in `self` with [`char::escape_unicode`].

# Examples

As an iterator:

```
for c in "❤\n!".escape_unicode() {
    print!("{c}");
}
println!();
```

Using `println!` directly:

```
println!("{}", "❤\n!".escape_unicode());
```


Both are equivalent to:

```
